import React from 'react';
import logo from './logo.svg';
import './App.css';
import Joke from './Joke';

function App(){
  return(
    <div>
      <Joke
        question="The crazy wall"
        punchline="No" 
      />
      <Joke
        question="The crazy cat"
        punchline="yes" 
      />
      <Joke
        question="The crazy dog"
        punchline="No" 
      />
      <Joke
        punchline="No" 
      />
      <Joke
        punchline="No" 
      />
  </div>
  )
}
export default App;
